import React from "react";

import Heading from "../components/layout-header";
import NavBar from "../components/layout-nav-bar";

const RightSidebarLayout = ({ main, sidebar, hide_sidebar }) => {

  const bodyTemplate = <><div className="col-12">{main}</div><div className="col-2">{sidebar}</div> </>;

  return (
    <div className="container-fluid movie-app">
      <div className="row d-flex align-items-center mt-4 mb-4">
        <Heading title="A to Z Fun" />
        <NavBar />
      </div>
      <div className="row">
         { bodyTemplate }
      </div>
    </div>
  );
};

export default RightSidebarLayout;
